script: |
  super -f text -I q7714.spq | sort > q7714.out

inputs:
  - name: q7714.spq
    data: |
      SELECT ALL col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - 84 + + 39 NOT IN ( + + 33, 58 + + 61, col0 * col1 - - 79 * + 20 + + col1, col0, 37 );
  - name: tab0

outputs:
  - name: q7714.out
    data: |
      1
      21
      81
